import Container from '@material-ui/core/Container'
import Typography from '@material-ui/core/Typography'

export default function Index() {
  return (
    <>
      <Container maxWidth="xl">
        <Typography variant="h3">
          Can't Stop Columbus
        </Typography>
        <Typography variant="h4">
          Table of Contents
        </Typography>
      </Container>
    </>
  );
}
